using System;
using System.Collections.Generic;
using System.Linq;
using System.Text;
using System.IO;
using System.Media;

namespace USBIRToyv2
{
    public class SoundManager
    {
        public static SoundPlayer Repeat;
        public static SoundPlayer Recognized;
        public static SoundPlayer Null;

        public static void Initialize()
        {
            Repeat = new System.Media.SoundPlayer(GetSound(SRepeat));
            Recognized = new System.Media.SoundPlayer(GetSound(SFound));
            Null = new System.Media.SoundPlayer(GetSound(SNull));
        }
        private static MemoryStream GetSound(string sound)
        {
            return new MemoryStream(System.Convert.FromBase64String(sound));
        }

        #region Sounds
        private static string SRepeat = "";
        private static string SFound = "";
        private static string SNull = "";
        #endregion Sounds
    }
}
